package store

type InMemoryStore struct {
}

func (s InMemoryStore) Search(query string) []SearchResult {
	var results []SearchResult
	if len(query) > 0 {
		results = append(results, SearchResult{
			SlideId:   "abcd1234",
			Slide:     4,
				Path:      "/path/to/slide.pptx",
				Thumbnail: "",
				Match: SearchResultMatch{
				Text:   "Lorem ipsum " + query + " sit amet",
				Start:  12,
				Length: len(query),
			},
		},)
	}
	return results
}

func (s InMemoryStore) GetDocumentPathForSlideId(slideId string) string {
	return "/path/to/slide.pptx"
}
